const base_url = "http://localhost:3000/"

function auth() {
    $('#clearfindTodo').remove()
    $('#welcoming').text(localStorage.getItem('email'))
    if (!localStorage.getItem('access_token')) {
        $('#welcoming').hide()
        $('#form_login').show()
        $('#form_register').hide()
        $('#home').hide()
        $('#todoList').hide()
        $('#form_Add').hide()
        $('#form_Edit').hide()
        $('#LoginPage').show()
        $('#RegisterPage').show()
        $('#form_EditStatus').hide()
    } else {
        findAllTodo()
        $('#welcoming').show()
        $('#form_login').hide()
        $('#form_register').hide()
        $('#home').show()
        $('#todoList').show()
        $('#form_Add').hide()
        $('#form_Edit').hide()
        $('#form_EditStatus').hide()
        $('#LoginPage').hide()
        $('#RegisterPage').hide()
        $('#form_EditStatus').hide()
        $('#triggerForm_addTodo').show()
    }
}

function login() {
    $.ajax({
        url: base_url + "users/signin",
        method: 'post',
        data: {
            email: $('#email').val(),
            password: $('#password').val()
        }
    })
        .done(response => {
            localStorage.setItem('access_token', response.access_token)
            localStorage.setItem('email', $('#email').val())
            $('#email').val('')
            $('#password').val('')
            auth()
        })
        .fail(err => {
            console.log(err, "ini error")
        })
}

function logout() {
    var auth2 = gapi.auth2.getAuthInstance();
    auth2.signOut().then(function () {
      console.log('User signed out.');
    });
    localStorage.clear()
    auth()
}

function findAllTodo() {
    $.ajax({
        url: base_url + "todos",
        method: 'get',
        headers: {
            token: localStorage.getItem('access_token')
        }
    })
        .done(data => {
            console.log(data.data)
            for (let i of data.data) {
                $('#todoList').append(`
                <tr id='clearfindTodo'>
                    <th>${i.title}</th>
                    <th>${i.description}</th>
                    <th>${i.status}</th>
                    <th>${i.due_date.slice(0, 10)}</th>
                    <th>
                        <a href="#" onclick="deleteTodo(${i.id})">Delete</a>
                        <a href="#" onclick="editAll(${i.id})">EditAll</a>
                        <a href="#" onclick="editStatus(${i.id})">EditStatus</a>
                    </th>
                </tr>
            `)
            }
        })
        .fail(err => {
            console.log(err)
        })
}

